import React, {Component} from 'react';
import ReactDOM from 'react-dom';

import FilteredList from './FilteredList'
import 'bootstrap/dist/css/bootstrap.min.css';

const songs_list = [
  {name: "Cardigan", year: "2020", album: "Folklore", rate_by_me: "Good", length: "3.59", image: "cardigan.jpg"},
  {name: "Mine", year: "2010", album: "Speak Now", rate_by_me: "Good", length: "3.52", image: "mine.jpg"},
  {name: "The Last Great American Dynasty", year: "2020", album: "Folklore", rate_by_me: "Really Good", length: "3.51", image: "dynasty.jpg"},
  {name: "All Too Well", year: "2012", album: "Red", rate_by_me: "Really Good", length: "5.28", image: "all_too_well.jpg"},
  {name: "Cruel Summer", year: "2019", album: "Lover", rate_by_me: "Good", length: "2.58", image: "cruel_summer.jpg"},
  {name: "Style", year: "2015", album: "1989", rate_by_me: "Really Good", length: "3.51", image: "style.jpg"},
  {name: "Lover", year: "2019", album: "Lover", rate_by_me: "Really Good", length: "3.41", image: "lover.jpg"},
  {name: "Delicate", year: "2018", album: "Lover", rate_by_me: "Really Good", length: "3.52", image: "delicate.jpg"},
  {name: "The 1", year: "2020", album: "Folklore", rate_by_me: "Good", length: "3.30", image: "the_one.jpg"},
  {name: "Clean", year: "2015", album: "1989", rate_by_me: "Good", length: "4.31", image: "clean.jpg"},
  {name: "Teardrops On My Guitar", year: "2007", album: "Taylor Swift", rate_by_me: "Good", length: "3.35", image: "tog.jpg"},
  {name: "Our Song", year: "2007", album: "Taylor Swift", rate_by_me: "Really Good", length: "3.24", image: "our_song.jpg"},
]

class App extends Component {
  render() {
    return (
      <div>
        <FilteredList list={songs_list} />

      </div>
    )
  }
}

ReactDOM.render(<App />, document.getElementById("root"))
